    const [skinks, setSkinks] = useState([])
    const {uuid} = useParams()
    const navigate = useNavigate();

    useEffect(async () => {
        await fetch('https://valorant-api.com/v1/weapon/' + uuid).then(res => res.json()).then(res => console.log(res))
    }, [uuid])

    // if (skinks.uuid !== uuid){
